import React from 'react';
import styled from 'styled-components';
import { Title } from '../auth-info';

const Wrapper = styled.div`
  width: 844px;
  margin: 280px auto 50px;
`

export const StreamInfo = () => {
  return <Wrapper>
    <Title>
      Мобильный ID и Stream

    </Title>
  </Wrapper>
}
